import Inputs from '../../Components/Inputs';
import './index.css'



function Cadastro() {
    return (
        <main className='main'>
            <a className='voltar' href='/'><img src="./images/setaDeVoltar.svg" alt="Seta para voltar" /></a>
            <div className="texto-cadrasto">
                <h1>Pronto para <span> mudar</span>
                    <br /> sua vida?
                </h1>
            </div>
            <Inputs/>
        </main>
    );
}

export default Cadastro;
